function Shop(props) {
    const hour = props.hour;
    const isOpen = hour >= 9 && hour < 18;
    const now = new Date();
    const ActualHour = now.getHours();
    hour = ActualHour;
    return (
        <div>
            <h1>Welcome to our Shop!</h1>
            <p>Current hour: {ActualHour}h</p>
            <p>{isOpen ? "We are open!" : "Sorry, we are closed."}</p>
        </div>
    );
}   

export default Shop;
